import React from 'react';

function Categories() 
{
    return (
        <div>
            <h2>Nossas Categorias de Veículos</h2>
            <ul>
                <li>Híbridos e Elétricos</li>
                <li>GNV com/sem D-Taxi</li>
                <li>Carros Grandes (BAG)</li>
                <li>Veículos Flex</li>
            </ul>
        </div>
    );
}

export default Categories;
